import "./App.css";
import { Routes, Route, BrowserRouter } from "react-router-dom";
// import Sidenavbar from "./components/Sidenavbar/Sidenavbar";
import Sidenavbar from "./components/Sidenavbar/Sidenavbar";
import AddStudent from "./Pages/AddStudent/AddStudent"
import { NavbarContext, useNavbarContext } from "./context/Navabr/NavbarContext";

const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/sidenavbar" 
          element={

          <Sidenavbar />


        } />
        <Route path="/addstudent"
        element={<AddStudent />}
        />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
